import React from 'react';
import {useSelector} from 'react-redux';

const Footer:React.FC = ()=>{
    const isLogin = useSelector((state:any)=>state.isLogin);

    return (
        <>
            {isLogin?
                <div className="footer">
                    <div className="copy-right">
                    
                    </div>
                </div>
            :''}
        </>
        
    );
}

export default Footer;
